import styled from 'styled-components'



const StyledFeature = styled.div`
  display: flex;
  width: 100%;
`

const StyledFeatureBody = styled.div`
  background-color: gray;
  width: 500px;
`

const StyledFeatureImage = styled.div`
  background-color: red;
`

const Feature = () => (
  <StyledFeature>
    <StyledFeatureBody>
      <p>hi</p>
    </StyledFeatureBody>
    <StyledFeatureImage>
      <p>hi</p>

    </StyledFeatureImage>
  </StyledFeature>
)

export default Feature
